import React from "react";
import TestCard from "../../components/TestCard";

const Gallery = (props: any) => {
  return (
    <div>
      {/* //* Search Bar */}
      <input type="search" name="testSearch" id="testSearch" />
      {/* //* Test type filter */}
      <select name="testTypeSelector" id="testSelecter">
        <option value=""></option>
      </select>
      {/* //* Test Gallery */}
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
      <TestCard />
    </div>
  );
};

export default Gallery;
